        <a href="/home" className="flex items-center">
          <img src={volcano} className="h-8 mr-3 hover:bg-inherit" />
          <span className="self-center text-2xl font-semibold whitespace-nowrap text-white ">dola</span>
        </a>
        <a href="/domain" className="flex items-center  hover:bg-gray-700 border-black border mx-2">
          <span className="self-center text-2xl font-semibold whitespace-nowrap text-white ">Domain</span>
        </a>
        <a href="/domain" className="flex items-center  hover:bg-gray-700 border-black border">
          <span className="self-center text-2xl font-semibold whitespace-nowrap text-white ">Profile</span>
        </a>
      </div>
    </nav>


